let email = document.getElementById('email');

window.onload = () => {
    email.value = localStorage.getItem('userData');
};

const runLocalStorage = () => {
    localStorage.setItem('userData', email.value);

    alert(localStorage.getItem('userData'));
};

export { runLocalStorage };
